// Defining a dragon
class Drgn {
    constructor(name,type,habitat,trainable,atk,speed,armor,firepower,shotlimit,venom,jawstrength,stealth) {
        this.name = name;
        this.type = type;
        this.habitat = habitat;
        this.trainable = trainable;
        this.atk = atk;
        this.speed = speed;
        this.armor = armor;
        this.firepower = firepower;
        this.shotlimit = shotlimit;
        this.venom = venom;
        this.jawstrength = jawstrength;
        this.stealth = stealth;
    }
}

// Creating the HTYD dragons
export const drgns = [
    new Drgn('Ala Acorazada'),
    new Drgn('Alaeterna'),
    new Drgn('Ala licántropo'),
    new Drgn('Albañilero'),
    new Drgn('Alacambiante'),
    new Drgn('Artillería'),
    new Drgn('Buffalord'),
    new Drgn('Caldero'),
    new Drgn('Canto Mortal'),
    new Drgn('Cazaviento'),
    new Drgn('Clavagarras'),
    new Drgn('Centinela'),
    new Drgn('Cerro Espinoso'),
    new Drgn('Cola Quemante')

]
